r":"‪puller‬","FORCES_AND_MOTION_BASICS/pattern.0massUnitsKilograms":"‪{0}千克‬","FORCES_AND_MOTION_BASICS/appliedForce":"‪推力‬","FORCES_AND_MOTION_BASICS/frictionForce":"‪摩擦力‬","FORCES_AND_MOTION_BASICS/speed":"‪速度‬","FORCES_AND_MOTION_BASICS/pattern.0name.1valueUnitsVelocity":"‪{0} m/s‬","FORCES_AND_MOTION_BASICS/acceleration":"‪加速度‬","FORCES_AND_MOTION_BASICS/force":"‪力‬","FORCES_AND_MOTION_BASICS/forces":"‪力‬","FORCES_AND_MOTION_BASICS/masses":"‪质量‬","FORCES_AND_MOTION_BASICS/friction":"‪摩擦力‬","FORCES_AND_MOTION_BASICS/lots":"‪许多‬","FORCES_AND_MOTION_BASICS/none":"‪没有‬","FORCES_AND_MOTION_BASICS/motion.description":"‪Motion. There is a skateboard resting on a frictionless surface, with a figure standing to the left. A wooden crate is at rest on top of the skateboard. Other objects can be placed on top of the skateboard, but no more than three at a time can be present. The user controls the amount of external force the figure applies to the skateboard. To hear the masses of the objects read, navigate to the control panel and check 'Masses.'‬","FORCES_AND_MOTION_BASICS/motion.interface.description":"‪Tab to begin navigating around the simulation. Select Values in the control panel to hear the numerical value applied force. Select Masses in control panel to hear masses of objects in bin and on skateboard. Select Speed to hear description of the Speedof the skateboard. Press M at anytime to hear a description of the current motion of the skateboard, the force being applied to it, its mass, and its speed.‬","FORCES_AND_MOTION_BASICS/motion.leftItemGroup.description":"‪Press enter to activate left object bin. A refrigerator and a wooden crate are in this object bin.‬","FORCES_AND_MOTION_BASICS/motion.rightItemGroup.description":"‪Press enter to activate right object bin. A girl, a man, a trash can, and a mystery box are in this object bin.‬","FORCES_AND_MOTION_BASICS/pattern.0name.1valueUnitsAcceleration":"‪{0}: {1} m/s<sup>2</sup>‬","FORCES_AND_MOTION_BASICS/pattern.0va
